pragma solidity 0.5.12;

import "./Ownable.sol";
import "./Destroyable.sol";
import "./provableAPI.sol";
// import "../SafeMath.sol"
// import "../SignedSafeMath.sol"
contract CoinToss is Ownable, usingProvable, Destroyable {

  // using SafeMath for uint256;
  // using SignedSafeMath for int256;

  modifier costs(uint cost){
    require(msg.value >= 0.1 ether,"Not enough ETH sent!");
        _;
    }

  struct Game {
    address payable sender;
    uint256 amount;
  }
  struct Players{
    bool beforeGame;
    bytes32 queryId;
    // uint256 userBalance;
  }

  uint256 public balance;
  uint256 constant MAX_INT_FROM_BYTE = 256;
  uint256 constant NUM_RANDOM_BYTES_REQUESTED = 1;

  mapping(bytes32 => Game) private gameMapping;
  mapping(address => Players) public PlayerInfo;


  event GameResult(address payable owner, uint256 amountwon);
  event GeneratedNumber(uint256 gameResult);
  event LogNewProvableQuery(string description, bytes32 queryId);

  constructor() public{
    provable_setProof(proofType_Ledger);
    }

  function bet() public payable returns (bytes32){
    require(PlayerInfo[msg.sender].beforeGame == true, "You are still in the game.");
    require(msg.value <= balance, "Sender cant exceed current balance and need place bet.");
    PlayerInfo[msg.sender].beforeGame = false;
    bytes32 queryId = oracleRandom();  //testRandom();
    Game memory newGame = Game(msg.sender, msg.value);
    gameMapping[queryId] = newGame;

    return queryId;
  }
  function oracleRandom() private returns (bytes32){
    uint256 QUERY_EXECUTION_DELAY = 0;
    uint256 GAS_FOR_CALLBACK = 200000;
    // bytes32 queryId = testRandom();
      bytes32 queryId = provable_newRandomDSQuery(
          QUERY_EXECUTION_DELAY,
          NUM_RANDOM_BYTES_REQUESTED,
          GAS_FOR_CALLBACK

    );
    uint256 provablePrice = provable_getPrice("Random", GAS_FOR_CALLBACK);
    require(balance > msg.value + provablePrice,"Sorry contract has not enough money");
    balance = msg.value - provablePrice;
    emit LogNewProvableQuery("Provable query was sent, standing by for the answer...", queryId);
    PlayerInfo[msg.sender].beforeGame = false;
    return queryId;
  }
  function __callback(bytes32 _queryId,string memory _result,bytes memory _proof) public {
    require(msg.sender == provable_cbAddress());
    if (provable_randomDS_proofVerify__returnCode(
                _queryId,
                _result,
                _proof
            ) != 0
        ) {
        } else {

    uint8 gameResult = uint8(uint256(keccak256(abi.encodePacked(_result))) % 2);
    Game memory existingGame = gameMapping[_queryId];
    delete( gameMapping[_queryId]);
    processResult(existingGame.sender, existingGame.amount, gameResult);
    emit GeneratedNumber(gameResult);
    }
    PlayerInfo[msg.sender].beforeGame = true;
  }
  function processResult(address payable player, uint256 amount, uint8 result) private {
    if (result == 0){
      balance += amount;
      emit GameResult(player, 0);
    } else {
      player.transfer(amount*2);
      balance -= amount;
      emit GameResult (player, amount);
    }
  }
  function getBalance() public view returns (uint256){
    return address(this).balance;
  }
  function fund() public payable onlyOwner returns (uint256){
    balance += msg.value;
  }
  function withdrawAll() public onlyOwner returns (uint256){
    uint toTransfer = balance;
    balance = 0;
    msg.sender.transfer(toTransfer);
    return toTransfer;
  }
  // function testRandom() public returns (bytes32){
  //   bytes32 queryId = bytes32(keccak256(abi.encodePacked(msg.sender)));
  //   __callback(queryId, "1", bytes("test"));
  //   emit LogNewProvableQuery("Provable query was sent, standing by for the answer...", queryId);
  //   return queryId;
  // }
}
